import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { Typography, Box, Card, Button, Stack, CssBaseline } from '@mui/material';
import { createTheme, ThemeProvider, styled } from '@mui/material/styles';

// Tema Gelap
const darkTheme = createTheme({
  palette: {
    mode: 'dark',
  },
});

// Styling untuk Card
const StyledCard = styled(Card)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignSelf: 'center',
  padding: theme.spacing(4),
  gap: theme.spacing(2),
  width: '100%',
  maxWidth: '500px',
  margin: 'auto',
  textAlign: 'center', // Pusatkan semua teks
}));

// Styling untuk Container
const CheckPageContainer = styled(Stack)(({ theme }) => ({
  minHeight: '100vh',
  justifyContent: 'center',
  alignItems: 'center',
  padding: theme.spacing(2),
  background: 'radial-gradient(circle, rgba(25,25,60,1) 0%, rgba(0,0,0,1) 100%)',
}));

const CheckPage = () => {
  const navigate = useNavigate();
  const location = useLocation();

  // Ambil parameter dari URL
  const queryParams = new URLSearchParams(location.search);
  const devisi = queryParams.get('devisi') || 'Account Management';
  const subDevisi = queryParams.get('subDevisi') || 'FrontEnd';

  // Data pengguna default
  const user = {
    idTele: '1234567890',
    email: 'user@example.com',
    nama: 'John Doe',
    telepon: '08123456789',
    devisi: devisi,
    subDevisi: subDevisi,
  };

  return (
    <ThemeProvider theme={darkTheme}>
      <CssBaseline />
      <CheckPageContainer>
        <StyledCard>
          <Typography component="h1" variant="h5" sx={{ color: 'white', marginBottom: 2 }}>
            User Information
          </Typography>

          <Box>
            <Typography sx={{ color: 'white', marginBottom: 1 }}>
              ID Telegram: <span>{user.idTele}</span>
            </Typography>
            <Typography sx={{ color: 'white', marginBottom: 1 }}>
              Email: <span>{user.email}</span>
            </Typography>
            <Typography sx={{ color: 'white', marginBottom: 1 }}>
              Nama: <span>{user.nama}</span>
            </Typography>
            <Typography sx={{ color: 'white', marginBottom: 1 }}>
              Telepon: <span>{user.telepon}</span>
            </Typography>
            <Typography sx={{ color: 'white', marginBottom: 1 }}>
              Devisi: <span>{user.devisi}</span>
            </Typography>
            <Typography sx={{ color: 'white', marginBottom: 1 }}>
              Sub-Devisi: <span>{user.subDevisi}</span>
            </Typography>
          </Box>

          <Button
            variant="contained"
            sx={{
              backgroundColor: 'white',
              color: 'black',
              '&:hover': { backgroundColor: '#f0f0f0' },
              marginTop: 2,
            }}
            onClick={() => navigate(`/interview?idTele=${encodeURIComponent(user.idTele)}`)}
          >
            CONFIRM
          </Button>
        </StyledCard>
      </CheckPageContainer>
    </ThemeProvider>
  );
};

export default CheckPage;
